import React from "react";
import '../App.css';
import Button from "../components/Button";


const Todos = (props) =>{
    return (
       <div className="todos_wrapper">
        <ul className="todos">
        {props.todos.map((todo) => (
          
          <Todo props={todo} key={todo.id}/>

        ))}
        </ul>
       </div>

    )
}

export default Todos;
